import React from 'react';
import {Box, ThemeProvider, Typography} from "@mui/material";
import {themeOptions} from "./theme";

function App() {
    return (
        <ThemeProvider theme={themeOptions}>
            <Box>
                <Box sx={{
                    position: "fixed"
                }}>
                    <Box sx={{
                        marginLeft: "74px",
                        marginTop: "30px",
                        display: "flex",
                        flexDirection: "row"
                    }}>
                        <Typography
                            variant={"h1"}
                            sx={{
                                fontFamily: "roboto",
                                color: "white"
                            }}>
                            Jialiang Zhou
                        </Typography>
                    </Box>
                </Box>

                <Box
                    sx={{
                        height: "600px",
                        backgroundColor: "#355834",
                        display: "flex",
                        justifyContent: "center",
                        alignItems: "center"
                    }}>
                    <Box>
                        <Typography variant={"h3"}
                                    sx={{
                                        fontFamily: "roboto",
                                        color: "white"
                                    }}>
                            Hi, I am JZ
                        </Typography>
                        <Typography sx={{
                            fontFamily: "roboto",
                            color: "white"
                        }}>
                            I am a frontend developer, uiux designer, and
                            musician
                        </Typography>
                    </Box>
                </Box>

                <Box
                    sx={{
                        height: "800px",
                        backgroundColor: "#FFF5DC"
                    }}>
                {/*    "#2A2A2A"*/}

                </Box>
            </Box>

        </ThemeProvider>

    );
}

export default App;
